import React from "react";
import LoginForm from "./components/LoginForm";
import "./App.css"
import { BrowserRouter as Router, Routes, Switch, Link, Redicect, Route } from "react-router-dom";


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" component={LoginForm} />
      </Routes>
    </Router>
  );
}


export default App;
